import { effect } from "../animation";

export default function Card({ newData }) {
  // let style = {
  //   translate: "none",
  //   rotate: "none",
  //   scale: "none",
  //   transform: "translate(-50%, -50%) translate(1000px, 0px)",
  // };
  useEffect(useLayoutEffect(effect, []), []);

  return (
    <>
      <div className="wheel__card">
        <div></div>
        <div></div>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/0/0f/IU_posing_for_Marie_Claire_Korea_March_2022_issue_03.jpg"
          alt=""
        ></img>
      </div>
      <div className="wheel__card">
        <div></div>
        <div></div>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/0/0f/IU_posing_for_Marie_Claire_Korea_March_2022_issue_03.jpg"
          alt=""
        ></img>
      </div>
      {newData.map((el) => {
        return (
          <div className="wheel__card" key={el.rnum}>
            <div>{el.rank}</div>
            <div></div>
            <img
              src="https://w.namu.la/s/59bbf73b123d0f9f693be3c3de9506b24a1f2a3067b4ffd0207a3a08eee32d750ebf1ca3e33084aa3bbcd6916bd0a8a187cc4556b87fa269c25f1a7ff3ea279f1e372d23aa0a6eee8d5932c70d5dac0e775cb479146a5c95b4596a83f8dfcc64675534264ec5a1dab1a9744809c8f965"
              alt=""
            ></img>
          </div>
        );
      })}
    </>
  );
}
